import React from 'react'
import { Link } from 'react-router-dom'
import './NavBar.css';

function NavBar() {
    return (
        <div className="navbar">
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/contact">Contact</Link></li>
                <li><Link to="/projects">Projects</Link></li>
            </ul>
        </div>
    );
}

export default NavBar;
